INSERT INTO rhapsody_blog VALUES
    (NULL,'19.2.0','https://realta.co.id/hospitality-system/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'Super User','admin','realta@realta.co.id','$2y$10$Dj2PXXE.I7w62SFkS/r5/u3DgpHXI8wn6ZypRlAKjPW6C5giMdpGa',0,1,'2018-09-06 14:51:06','2021-05-18 10:40:34',0,NULL,'0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,89,'Rhapsody Mendukung Pendidikan di Sumba Hospitality Foundation','sumba-hospitality-foundation','<p><a href="http://sumbahospitalityfoundation.org/" target="_blank" rel="noopener noreferrer"><strong>Sumba Hospitality Foundation</strong></a> yang didirikan oleh seorang wanita berkebangsaan Belgia bernama Inge De Lathauwer memiliki tujuan mulia, yakni memajukan dan menyejahterakan...</p>','<p> <img src="images/blog/sumba-hospitality-students.jpg" alt="" width="790" height="527" /></p>
<p>Terdapat delapan staf tenaga pengajar tetap yang mendedikasikan waktu, pengetahuan serta keahlian mereka masing-masing untuk membantu mendidik para murid, yang semuanya berkebangsaan asing. Thomas Lerch, yang berkebangsaan Jerman, adalah kepala sekolah sekaligus tenaga pengajar untuk housekeeping dan front office. Untuk mengajari cara memasak masakan yang lezat dan menyajikannya dengan menarik, ada Chef Alex dari Italia dan Chef Pong dari Filipina. Lalu, ada juga Caroline dari Swiss dan Aliya dari Perancis yang membagikan ilmu mereka mengenai food &amp; beverage services. Tim pengajar tetap menjadi lengkap dengan hadirnya Juul dari Belanda yang membantu melatih para murid bagaimana memberikan pelayanan terbaik kepada para tamu di front office.</p>
<p> </p>
<p>Kurikulum pendidikan di atas sangat sesuai dengan hotel management system<strong> Rhapsody</strong>. Memiliki modul-modul yang lengkap dan terintegrasi penuh secara otomatis, mulai dari front office dan back office hingga logistic, pemanfaatan Rhapsody sangatlah tepat dalam mendukung pendidikan di Sumba Hospitality Foundation. Para murid bukan hanya belajar mengenai teori dan praktek mengenai hospitality, namun mereka juga diberi perkenalan terhadap hotel management system dan diajarkan bagaimana cara memanfaatkan sistem tersebut untuk memperlancar kegiatan operasional sehari-hari.</p>
<p> </p>
<p>Selain pendidikan dan pelatihan tentang hospitality, Sumba Hospitality Foundation juga memiliki proyek lain, seperti kelas Bahasa Inggris dan permakultur. Karena semua tenaga pengajar tetapnya adalah warga negara asing, maka pendidikan diberikan dalam bahasa Inggris. Untuk mendukung kelancaran aktivitas di kelas dan saat berinteraksi dengan para wisatawan yang banyak berasal dari luar negeri, maka diadakanlah kelas Bahasa Inggris, yang dipimpin langsung oleh tenaga pengajar dari Inggris bernama Linda.</p>
<p> </p>
<p>Para murid juga mendapat kelas tambahan untuk belajar mengenai permakultur. Dengan membuat mereka lebih aware bahwa mother nature adalah bagian dari kehidupan yang harus dirawat dan dijaga dengan baik, Foundation ini berharap agar alam di Sumba selalu terawat dengan baik dan tidak mengalami kerusakan. Dengan adanya kelas permakultur, para murid jadi tahu bagaimana menanam dan memanen hasil pangan organik.</p>
<p> </p>
<p>Dengan pendidikan dan pelatihan yang disediakan, Sumba Hospitality Foundation dan Realta berharap akan masa depan yang lebih baik dan cerah bagi generasi muda Sumba, yang pada akhirnya akan meningkatkan perekonomian serta kesejahteraan masyarakat Sumba secara umum.</p>
<p> </p>
<p><a href="pricing"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/rhapsody_20.png" alt="" /></a></p>',1,'2019-05-14 09:24:57',NULL,'2021-03-24 03:02:40','2019-05-14 09:24:57','0000-00-00 00:00:00','{"image_intro":"images\\/blog\\/sumba-hospitality-students-realta.jpg","float_intro":"","image_intro_alt":"Rhapsody Mendukung Pendidikan di Sumba Hospitality Foundation","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"article_layout":"","show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","info_block_show_title":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_associations":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_page_title":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":"","spfeatured_image":"","spfeatured_image_alt":"","post_format":"standard","gallery":"","audio":"","video":"","link_title":"","link_url":"","quote_text":"","quote_author":"","post_status":""}',14,'Sumba Hospitality Foundation, Rhapsody, hospitality in management, hospitality management system','Sumba Hospitality Foundation yang didirikan oleh seorang wanita berkebangsaan Belgia bernama Inge De Lathauwer memiliki tujuan mulia, yakni memajukan dan menyejahterakan...',30704,'{"robots":"","author":"","rights":"","xreference":""}','*',NULL,NULL,'admin','louis','blog',1,0,20,6,'/hospitality-system/blog/article-news/89-sumba-hospitality-foundation',NULL,NULL),
